function ProductListItem(value) {
  const date = new Date(value);
  return `${date.getFullYear()}. ${date.getMonth() + 1}. ${date.getDate()}`;
}

function ProductList({ products }) {
  return (
    <div>
      <img src={products.images} />
    </div>
  );
}

export default ProductList;
